import React from 'react';
import { Button } from '@material-ui/core';

import './Players.css';

const Players = () => {
  return (
    <div>
      <h2>Players works!</h2>
      <Button
        className="Button"
        size="large"
        variant="contained"
        styles={{ background: yellow }}
      >
        OK
      </Button>
    </div>
  );
};

export default Players;
